import React from "react";

const ProjectCard = ({ title, date, concept, imgPath }) => {
  const displayCard = (
    <div className="card mb-3" style={{ minWidth: 540 }}>
      <div className="row g-0">
        <div className="col-md-4">
          <img src={imgPath} className="img-fluid rounded-start" alt={title} />
        </div>
        <div className="col-md-8">
          <div className="card-body">
            <h5 className="card-title">{title}</h5>
            <p className="card-text">
              <small className="text-muted">{date}</small>
            </p>
            <p className="card-text">{concept}</p>
          </div>
        </div>
      </div>
    </div>
  );

  return <div>{displayCard}</div>;
};

export default ProjectCard;
